import TextField from '@material-ui/core/TextField';

const style = {
    height: '100px'
};

const Login = () =>{
    return(
        <form>
             <TextField
                disabled
                id="outlined-disabled"
                label="Disabled"
                defaultValue="Hello World"
                variant="outlined"
            />
        </form>
    )
}

export default Login;
